    data = [];
    children = [];
    parent = null;

    appendChild(node) {
        node.parent = this;
        this.children.push(node);
        return node;
    }

    checkForCircular(id) {
        let node = this.parent;
        if (node !== null) {
            let data = node.data;
            for (let i = data.length - 1; i > -1; --i) {
                if (node.data[i].id && node.data[i].id === id) {
                    return node.data[i];
                }

                return node.checkForCircular(id);
            }
